import { Grid } from "@mui/material";

import PostForm from "./components/PostForm/PostForm";
import Members from "./components/Members/Members";
import Posts from "./components/Posts/Posts";
import "./App.css";

function App() {
  return (
    <Grid container className="App">
      <Grid item md={8}>
        <PostForm />
      </Grid>
      <Grid item md={1}>
        <Members />
      </Grid>
      <Grid item md={3}>
        <Posts />
      </Grid>
    </Grid>
  );
}

export default App;
